import './sass/main.css';
import logo from './logo.svg';

function App() {

  return (

   <div>
    <nav class="navbar navbar-light bg-light">
      <div class="container-fluid">
        <a class="navbar-brand" href="#">
        <img src={"./logo.jpeg"} />
        </a>
      </div>
    </nav>
    </div>

  );

}

export default App;
